const App = () =>
{
	const todoData = [
		{label: 'Дело №1', important: false},
		{label: 'Дело №2', important: true},
		{label: 'Дело №3', important: false},
	];
	return(
		<div>
			<AppHeader/>
			<SearchPanel/>
			<TodoList/>
		</div>
	);
};

